import Link from "next/link";

const LandingHeader = () => (
  <div className="landing">
    <div className="landing--wrapper">
      <h1>Woo Young Choi studios</h1>
      <p>Software engineer based in New York, NY.</p>
      <p>Specializing in building and designing websites and applications.</p>
    </div>
    <style jsx>
      {`
        .landing {
          align-items: center;
          display: flex;
          flex-direction: column;
          font-family: "Futura";
          justify-content: center;
          min-height: 100vh;
          text-align: center;
        }

        h1 {
          color: #3366cc;
          font-size: 50px;
          font-weight: 600;
        }

        p {
          color: #3366cc;
          font-size: 18px;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
